`,"- ","한국어: ","안녕하세요, ","빛의 ","도시로 ","오세요.",`
`,"- ","English: ","Welcome ","to ","the ","city ","of ","light.",`
`,"- ","日本語: ","光の都市へようこそ。",`
`,"- ","简体中文: ","欢迎来到光之城。",`
`,"- ","العربية ","(RTL): ","مرحبًا ","بكم ","في ","مدينة ","النور ","⭐️",`
`,"---",`
`,"## ","5. ","참조/각주",`
